import React from "react";
import styled from "styled-components";

const Container = styled.div`
  background-color: white;
  width: 70%;
  height: 250px;
  border-radius: 20px;
`;
const Input = () => {
  return (
    <Container>
      <label htmlFor="user-name">UserName</label>
      <input id="user-name" />
    </Container>
  );
};

export default Input;
